description:
Storyline: Inspired by his love of comic books, Dave becomes Kick-Ass, a masked crime fighter despite having no powers. But he's up against Big Daddy and Hit Girl, a father-daughter crime-fighting duo who've declared war on a New York mafioso. Soon he's in a world of bullets where he'll have to live up to his name.


